import React from 'react';

function Login() {
    return (
        <form name="login-form" className="popup__container">
            <h2 className="popup__container-name">Вход</h2>
            <input id="name-input" type="text" name="name" placeholder="Email"  className="popup__container-input" minLength="2" maxLength="40" required />
            <span className="name-input-error popup__container-input-error"></span>
            <input id="job-input" type="text" name="about" placeholder="Пароль" className="popup__container-input" minLength="2" maxLength="200" required />
            <span className="job-input-error popup__container-input-error"></span>
            <button type="submit" className="popup__container-submit-button popup__container-submit-button" >Войти</button>
        </form>
    );
}

export default Login;
